import React, { Component } from "react";
import {
  List,
  Card,
  Avatar,
  Row,
  Col,
  Typography,
  Progress,
  Icon,
  Button
} from "antd";
import IndividualSkill from "./indSkill.js";
const { Meta } = Card;
const { Title } = Typography;

export default class recentProjects extends Component {
  render() {
    return (
      <div style={{ textAlign: "Center" }}>
        <br />
        <Title level={4}>Recent Projects</Title>
        <br />
        <Row>
          <Col />
        </Row>
        <Card
          style={{ width: 300 }}
          //   cover={
          //     <img
          //       alt="example"
          //       src="https://gw.alipayobjects.com/zos/rmsportal/JiqGstEfoWAOHiTxclqi.png"
          //     />
          //   }
          actions={[
            <Button type="primary">Github Link</Button>,
            <Button style={{ backgroundColor: "red", color: "white" }}>
              Website
            </Button>
          ]}
        >
          <Meta
            // avatar={
            //   <Avatar src="https://zos.alipayobjects.com/rmsportal/ODTLcjxAfvqbxHnVXCYX.png" />
            // }
            title="Petshop with Ethereum"
            description="Adoption of pets on a DApp built using Ethereum and Solidity platform and Truffle"
          />
        </Card>
      </div>
    );
  }
}
